class Solution:
    def lengthOfLongestSubstring(self, s: str) -> int:
        count = 0
        total_unique = set(s)
        for i in range(0,len(s)-1):
            for j in range(0,len(s)):
                if len(s[i:j+1]) == len(set(s[i:j+1])):
                    if len(s[i:j+1]) >= count:
                        count = len(s[i:j+1])
        if count == 0 and len(s) != 0:
            return len(set(s))
        
        else:
            return count

